import React from "react";
import { describe, it, expect, vi,spyOn } from "vitest";
import { render, screen, fireEvent, waitFor } from "@testing-library/react";
import "@testing-library/jest-dom";
import ReviewsDisplay from "../../src/components/ReviewsDisplay/ReviewsDisplay";
import { BrowserRouter } from "react-router-dom";
import AddReviewForm from "../../src/components/AddReviewForm/AddReviewForm";
import { MemoryRouter, Route, Routes } from "react-router-dom";
import { addReviewApi } from "../../src/services/APIs/ReviewApi";
import EditReviewForm from "../../src/components/EditReviewForm/EditReviewForm";
vi.mock("../src/services/APIs/ProductApi", () => ({
  updateMemberApi: vi.fn(),
  deleteMemberApi: vi.fn(),
}));
vi.mock("../src/services/APIs/ReviewApi", () => ({
  addReviewApi: vi.fn()
}));
describe("Review display Component", () => {
  let mockReviewData = [
    {
      id: 17,
      content: "sucked up blood good",
      rating: 5,
      user_id: 13,
      product_id: 2,
      created_time: "2023-11-25T18:35:37.000Z",
      review_image: "image",
      username: "test8",
      profile_image: null,
    },
    {
      id: 113,
      content: "test",
      rating: 3,
      user_id: 273,
      product_id: 2,
      created_time: "2024-01-27T12:34:43.000Z",
      username: "admin",
      profile_image: null,
      review_image:
        "data:image/png;base64,",
    },
  ];
  let mockCurrentUserId = "273";
  let mockProductDetails = {
    id: 2,
    seller_id: 273,
    product_name: "Sanitary Pads",
    product_description: "To suck up blood",
    product_image:
      "data:image/jpeg;base64,",
    product_quantity: 2,
    created_time: "2023-11-24T16:20:52.000Z",
    sold_quantity: null,
  };
  it("should display the reviews ", async () => {
    const { container } = render(
      <BrowserRouter>
        <ReviewsDisplay
          reviews={mockReviewData}
          currentUserId={mockCurrentUserId}
          productDetails={mockProductDetails}
        />
      </BrowserRouter>
    );

    const review1Name = screen.getByText("admin");
    expect(review1Name).toBeInTheDocument();
    const review2name = screen.getByText("test8");
    expect(review2name).toBeInTheDocument();
    const review1Date = screen.getByText(
      "Reviewed in Singapore on November 26, 2023"
    );
    expect(review1Date).toBeInTheDocument();
    const review1Content = screen.getByText("sucked up blood good");
    expect(review1Content).toBeInTheDocument();

    const review2Content = screen.getByText("test");
    expect(review2Content).toBeInTheDocument();
    const review2date = screen.getByText(
      "Reviewed in Singapore on January 27, 2024"
    );
    expect(review2date).toBeInTheDocument();
    const review2ImageText = screen.getByText("Attached image:");
    expect(review2ImageText).toBeInTheDocument();
    const review2Image = screen.getByAltText("review_image");
    expect(review2Image);

    const penButton = screen.getByTestId("editButton");
    const review2Delete = screen.getByTestId("trashButton113");
    expect(penButton).toBeInTheDocument();
    expect(review2Delete).toBeInTheDocument();
    const ratingContainers = container.querySelectorAll(".rating-container");

    // Iterate over each rating container
    ratingContainers.forEach((ratingContainer, index) => {
      // Select all fa-star elements within the current rating container using attribute selector
      let stars = ratingContainer.querySelectorAll('.fa-star[color="gold"]');

      // Assert the number of stars for each rating container
      expect(stars.length).toBe(mockReviewData[index].rating);
    });

  }); it("should delete a reviews ", () => {
    window.confirm = vi.fn(() => true);
    const { container } = render(
      <BrowserRouter>
        <ReviewsDisplay
          reviews={mockReviewData}
          currentUserId={mockCurrentUserId}
          productDetails={mockProductDetails}
        />
      </BrowserRouter>
    );
    const trashButton = screen.getByTestId("trashButton113");
    expect(trashButton).toBeInTheDocument();
    fireEvent.click(trashButton);
    expect(window.confirm).toHaveBeenCalledWith("Are you sure you want to delete your review?.");
  });
  it("should display Add reviews ", () => {
    const mockParams = "aa-i149";
    const { container } = render(
      <MemoryRouter initialEntries={[`/add-review/${mockParams}`]}>
        <Routes>
          <Route
            path="/add-review/:productId"
            element={<AddReviewForm></AddReviewForm>}
          />
        </Routes>
      </MemoryRouter>
    );
    const title = screen.getByText("Create Review");
    expect(title).toBeInTheDocument();
    const overallRating = screen.getByText("Overall rating");
    expect(overallRating).toBeInTheDocument();
    const starSelector = container.querySelector(".starSelector");
    let stars = starSelector.querySelectorAll('.fa-star[color="grey"]');
    expect(stars.length).toBe(5);
    const addAPhoto = screen.getByText("Add a photo");
    expect(addAPhoto);
    const imageDropArea = screen.getByTestId("image-drop-area");
    expect(imageDropArea).toBeInTheDocument();
    const addAWrittenReview = screen.getByText("Add a written review");
    expect(addAWrittenReview).toBeInTheDocument();
    const reviewContentTextArea = screen.getByTestId("reviewContentTextArea");
    expect(reviewContentTextArea).toBeInTheDocument();
  }); 
 
  it("should add a review", async () => {
    const mockParams = "aa-i149";
    const { container } = render(
      <MemoryRouter initialEntries={[`/add-review/${mockParams}`]}>
        <Routes>
          <Route
            path="/add-review/:productId"
            element={<AddReviewForm></AddReviewForm>}
          />
        </Routes>
      </MemoryRouter>
    );
    const reviewContentTextArea = screen.getByTestId("reviewContentTextArea");
    expect(reviewContentTextArea).toBeInTheDocument();
    fireEvent.change(reviewContentTextArea, { target: { value: "test" } });
    expect(reviewContentTextArea.value).toBe("test");
    // Simulate click on star 3
    const star3 = screen.getByTestId("3");
    fireEvent.click(star3);
    // Expect screen to show 3 gold stars
    const starSelector = container.querySelector(".starSelector");
    let stars = starSelector.querySelectorAll('.fa-star[color="gold"]');
    expect(stars.length).toBe(3);

    // Test
    const fileInput = screen.getByTestId("file-input");
    fireEvent.change(fileInput, {
      target: {
        files: [new File(["test upload"], "test.png", { type: "image/png" })],
      },
    });
    await waitFor(() => {
      const imagePreview = screen.getByTestId("addTarget");
      expect(imagePreview).toHaveAttribute(
        "src",
        "data:image/png;base64,dGVzdCB1cGxvYWQ="
      );
    });
    const submitButton = screen.getByTestId("submit-button");
    expect(submitButton).toBeInTheDocument();
    //fireEvent.click(submitButton);
    expect(addReviewApi).toHaveBeenCalledOnce;
  });
 
  it("should display Edit reviews ", () => {
    const mockParams = "178";
    const { container } = render(
      <MemoryRouter initialEntries={[`/edit-review/${mockParams}`]}>
        <Routes>
          <Route
            path="/edit-review/:reviewId"
            element={<EditReviewForm/>}
          />
        </Routes>
      </MemoryRouter>
    );
    const title = screen.getByText("Edit Review");
    expect(title).toBeInTheDocument();
    const overallRating = screen.getByText("Overall rating");
    expect(overallRating).toBeInTheDocument();
    const starSelector = container.querySelector(".starSelector");
    let stars = starSelector.querySelectorAll('.fa-star[color="grey"]');
    expect(stars.length).toBe(5);
    const addAPhoto = screen.getByText("Add a photo");
    expect(addAPhoto);
    const imageDropArea = screen.getByTestId("image-drop-area");
    expect(imageDropArea).toBeInTheDocument();
    const addAWrittenReview = screen.getByText("Add a written review");
    expect(addAWrittenReview).toBeInTheDocument();
    const reviewContentTextArea = screen.getByTestId("reviewContentTextArea");
    expect(reviewContentTextArea).toBeInTheDocument();
    
  });
  it("should edit a review", async () => {
    const mockParams = "178";
    const { container } = render(
      <MemoryRouter initialEntries={[`/edit-review/${mockParams}`]}>
        <Routes>
          <Route
            path="/edit-review/:productId"
            element={<EditReviewForm/>}
          />
        </Routes>
      </MemoryRouter>
    );
    const reviewContentTextArea = screen.getByTestId("reviewContentTextArea");
    expect(reviewContentTextArea).toBeInTheDocument();
    fireEvent.change(reviewContentTextArea, { target: { value: "test" } });
    expect(reviewContentTextArea.value).toBe("test");
    // Simulate click on star 3
    const star3 = screen.getByTestId("3");
    fireEvent.click(star3);
    // Expect screen to show 3 gold stars
    const starSelector = container.querySelector(".starSelector");
    let stars = starSelector.querySelectorAll('.fa-star[color="gold"]');
    expect(stars.length).toBe(3);

    // Test
    const fileInput = screen.getByTestId("file-input");
    fireEvent.change(fileInput, {
      target: {
        files: [new File(["test upload"], "test.png", { type: "image/png" })],
      },
    });
    await waitFor(() => {
      const imagePreview = screen.getByTestId("addTarget");
      expect(imagePreview).toHaveAttribute(
        "src",
        "data:image/png;base64,dGVzdCB1cGxvYWQ="
      );
    });
    const submitButton = screen.getByTestId("submit-button");
    expect(submitButton).toBeInTheDocument();
    //fireEvent.click(submitButton);
    expect(addReviewApi).toHaveBeenCalledOnce;
  });
});
